  <style>
    * {
      margin: 0;
      padding: 0;
    }

    ul {
      width: 1000px;
    }

    ul:before,
    ul:after {
      content: " ";
      display: table;
    }

    ul:after {
      clear: both;
    }

    li {
      float: left;
      list-style: none;
      width: 10px;
      height: 10px;
      box-sizing: border-box;
      border: 1px solid #5f9bf5;
    }

    @media (max-width: 1000px) {
      ul li {
        float: none;
      }
    }
  </style>
